import React from "react";
import { Link, useParams } from "react-router-dom";

const EventsPage = () => {
  const params = useParams();

  DUMMY_EVENTS = [
    { id: "ev1", name: "event 1" },
    { id: "ev1", name: "event 1" },
    { id: "ev1", name: "event 1" },
  ];

  return (
    <>
      <h1 className="center">EventsPage</h1>
      <div className="center flex">
        <Link to={`${params.eventId}`}>Event 1</Link>
      </div>
    </>
  );
};

export default EventsPage;
